import { withFormik, Field, Form } from "formik";
import { React } from "react";
import reactDom from "react-dom";
import { Link } from "react-router-dom";
import { Container, Button } from "react-bootstrap";

const LoginPage = (values) => {

        const loginStyle = {
            margin: "33px auto 36px",
            maxWidth: "550px",
            padding: "35px",
        }

    return(
    <Container className="border border-secondary" style={loginStyle}>
        <Form>
            <Label>Admin Username</Label>
            <Field htmlFor="username" type="text" placeholder="Enter Username" />

            <Label>Admin Password</Label>
            <Field htmlFor="password" type="password" placeholder="Password" />

            <Button variant="primary" type="submit">Login</Button>

        </Form>
    </Container>
    )
};

const AdminLogin = withFormik({
    handleSubmit: (values) => {
        console.log(values.username)
        console.log(values.password)
    }
})(LoginPage)

export default AdminLogin;
